  `iSymbolCode` VARCHAR(64),
  `iExchSymbolCode` VARCHAR(64),
  
  `iSide` VARCHAR(16),
  `iPosSide` VARCHAR(16),
  `iOrderPrice` VARCHAR(48),
  `iOrderSize` VARCHAR(48),
  `iParValue` INT(11),
  
  `iOrderType` VARCHAR(16),
  `iOrderTypeExtra` VARCHAR(16),
  `iOrderTime` VARCHAR(32),
  
  `iSimedTDInfo` VARCHAR(64),
  
  `iFee` VARCHAR(48),
  `iFeeCurrency` VARCHAR(32),
  
  `iDealSize` VARCHAR(48),
  `iAvgDealPrice` VARCHAR(48),
  
  `iLastTradeId` VARCHAR(128),
  `iLastDealPrice` VARCHAR(48),
  `iLastDealSize` VARCHAR(48),
  `iLastDealTime` VARCHAR(32),
  
  `iOrderStatus` INT(11) UNSIGNED,
  
  `iNoUsedToCalcPos` BIGINT(22) UNSIGNED,  
  
  `iStatusCode` INT(11),
  `iStatusMsg` VARCHAR(4096)
)
BEGIN
  DECLARE origOrderStatus INT(11);
  DECLARE origDealSize DECIMAL(48, 18);

  START TRANSACTION;
  
  -- orderInfo
  IF NOT EXISTS ( SELECT * FROM `orderInfo` WHERE orderId = iOrderId ) THEN
    INSERT INTO `orderInfo`
      (`productId`       , 
        `userId`         , 
        `acctId`         , 
        `stgId`          , 
        `stgInstId`      , 
        `algoId`         , 
        `orderId`        , 
        `exchOrderId`    , 
        `parentOrderId`  , 
        `marketCode`     , 
        `symbolType`     , 
        `symbolCode`     , 
        `exchSymbolCode` , 
        `side`           , 
        `posSide`        , 
        `orderPrice`     , 
        `orderSize`      , 
        `parValue`       , 
        `orderType`      , 
        `orderTypeExtra` , 
        `orderTime`      , 
        `simedTDInfo`    ,
        `fee`            , 
        `feeCurrency`    , 
        `dealSize`       , 
        `avgDealPrice`   , 
        `lastTradeId`    , 
        `lastDealPrice`  , 
        `lastDealSize`   , 
        `lastDealTime`   , 
        `orderStatus`    , 
        `noUsedToCalcPos`, 
        `statusCode`     , 
        `statusMsg`      )
     VALUES
      ( iProductId       , 
        iUserId          , 
        iAcctId          , 
        iStgId           , 
        iStgInstId       , 
        iAlgoId          , 
        iOrderId         , 
        iExchOrderId     , 
        iParentOrderId   , 
        iMarketCode      , 
        iSymbolType      , 
        iSymbolCode      , 
        iExchSymbolCode  , 
        iSide            , 
        iPosSide         , 
        iOrderPrice      , 
        iOrderSize       , 
        iParValue        , 
        iOrderType       , 
        iOrderTypeExtra  , 
        iOrderTime       , 
        iSimedTDInfo     ,
        iFee             , 
        iFeeCurrency     , 
        iDealSize        , 
        iAvgDealPrice    , 
        iLastTradeId     , 
        iLastDealPrice   , 
        iLastDealSize    , 
        iLastDealTime    , 
        iOrderStatus     , 
        iNoUsedToCalcPos , 
        iStatusCode      , 
        iStatusMsg       );
  ELSE
    SELECT orderStatus, dealSize INTO @origOrderStatus, @origDealSize FROM `orderInfo` WHERE orderId = iOrderId LIMIT 1;    
    
    IF iOrderStatus > @origOrderStatus THEN
      IF @origOrderStatus < 100 THEN
        REPLACE INTO `orderInfo`
          (`productId`      , 
           `userId`         , 
           `acctId`         , 
           `stgId`          ,  
           `stgInstId`      , 
           `algoId`         , 
           `orderId`        , 
           `exchOrderId`    , 
           `parentOrderId`  , 
           `marketCode`     , 
           `symbolType`     , 
           `symbolCode`     , 
           `exchSymbolCode` , 
           `side`           , 
           `posSide`        , 
           `orderPrice`     , 
           `orderSize`      , 
           `parValue`       , 
           `orderType`      , 
           `orderTypeExtra` , 
           `orderTime`      , 
           `simedTDInfo`    ,
           `fee`            , 
           `feeCurrency`    , 
           `dealSize`       , 
           `avgDealPrice`   , 
           `lastTradeId`    , 
           `lastDealPrice`  , 
           `lastDealSize`   , 
           `lastDealTime`   , 
           `orderStatus`    , 
           `noUsedToCalcPos`, 
           `statusCode`     , 
           `statusMsg`      )
         VALUES
          ( iProductId      , 
            iUserId         , 
            iAcctId         , 
            iStgId          , 
            iStgInstId      , 
            iAlgoId         , 
            iOrderId        , 
            iExchOrderId    , 
            iParentOrderId  , 
            iMarketCode     , 
            iSymbolType     , 
            iSymbolCode     , 
            iExchSymbolCode , 
            iSide           , 
            iPosSide        , 
            iOrderPrice     , 
            iOrderSize      ,  
            iParValue       , 
            iOrderType      , 
            iOrderTypeExtra , 
            iOrderTime      , 
            iSimedTDInfo    ,
            iFee            , 
            iFeeCurrency    , 
            iDealSize       , 
            iAvgDealPrice   , 
            iLastTradeId    , 
            iLastDealPrice  , 
            iLastDealSize   , 
            iLastDealTime   , 
            iOrderStatus    , 
            iNoUsedToCalcPos, 
            iStatusCode     , 
            iStatusMsg      );
      END IF;
    END IF;
    
    IF (iOrderStatus = @origOrderStatus AND iOrderStatus = 20) THEN
      IF ABS(iDealSize) > ABS(@origDealSize) THEN
        REPLACE INTO `orderInfo`
          (`productId`      , 
           `userId`         , 
           `acctId`         , 
           `stgId`          , 
           `stgInstId`      , 
