           `lastDealTime`   , 
           `orderStatus`    , 
           `noUsedToCalcPos`, 
           `statusCode`     , 
           `statusMsg`      )
         VALUES
          ( iProductId      , 
            iUserId         , 
            iAcctId         , 
            iStgId          , 
            iStgInstId      , 
            iAlgoId         , 
            iOrderId        , 
            iExchOrderId    , 
