            iLastDealTime   , 
            iOrderStatus    , 
            iNoUsedToCalcPos, 
            iStatusCode     , 
            iStatusMsg      );
      END IF;
    END IF;
  END IF;
  
  -- tradeInfo
  IF iOrderStatus = 20 THEN
    IF ABS(iDealSize) > ABS(@origDealSize) THEN
      INSERT INTO `tradeInfo`
        (`productId`      , 
         `userId`         , 
